import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter  as Router} from "react-router-dom";
import "./index.css";
import App from "./App";

var destination = document.querySelector("#container");


ReactDOM.render(
	<Router><App /> </Router>,
    destination
);
